import React from "react";
import ReactDOM from "react-dom";
import Card from "./App";
import Sdata from "./Div";
//simport Sdata from "./Div";
//import "./index.css";


let con="netflix";
function newarr(con){
  


    
       <Card key={Sdata[2].id}
         imgsrc={Sdata[2].imgscr}
         title={Sdata[2].title}
         sname={Sdata[2].sname}
         link={Sdata[2].link}
/>

  }
  ReactDOM.render(
  <newarr />,
  document.getElementById("root") 
  );
